function SelectPath() {
  return (
    <div className="All-container">
      <div className="View-opd">
        <div className="View-opd-header">
          <h1 className="View-opd-header">Check OPD</h1>
          <p className="View-opd-p">
            See your OPD appointment details and easily book a time and number
            to visit the doctor without waiting or getting tired.
          </p>
          <input type="submit" className="View-opd-button" value="View OPD" />
        </div>
      </div>
    </div>
  );
}
export default SelectPath;
